INSERT INTO `bbs_content` VALUES (22, 'video', 'Java三端分离 ssm在线教育平台', '<table cellspacing=\"0\" cellpadding=\"0\" style=\"overflow-wrap: break-word; empty-cells: show; table-layout: fixed; width: 1277.6px; color: rgb(68, 68, 68); font-family: &quot;Microsoft yahei&quot;, Tahoma, Helvetica, SimSun, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\"><tbody style=\"overflow-wrap: break-word;\"><tr style=\"overflow-wrap: break-word;\"><td class=\"t_f\" id=\"postmessage_529\" style=\"overflow-wrap: break-word; font-size: 14px;\">1-1 ——课程内容收获，技能介绍及项目演示<br style=\"overflow-wrap: break-word;\">1-2 （补充）学习前期整体概要介绍<br style=\"overflow-wrap: break-word;\">1-3 （补充）项目源码导入，配置，运行，入坑，出坑-1<br style=\"overflow-wrap: break-word;\">1-4 （补充）项目源码导入，配置，运行，入坑，出坑-2<br style=\"overflow-wrap: break-word;\">1-5 （补充）项目结构，源码整体解析-1<br style=\"overflow-wrap: break-word;\">1-6 （补充）项目结构，源码整体解析-2<br style=\"overflow-wrap: break-word;\">1-7 （补充）常见问题解答<br style=\"overflow-wrap: break-word;\">1-8 ——Eclipse、Maven、JDK介绍<br style=\"overflow-wrap: break-word;\">1-9 ——Maven构建Project-01<br style=\"overflow-wrap: break-word;\">1-10 ——Maven构建Project-02<br style=\"overflow-wrap: break-word;\">1-11 ——新浪SAE介绍-01<br style=\"overflow-wrap: break-word;\">1-12 ——新浪SAE介绍-02<br style=\"overflow-wrap: break-word;\">2-1 ——平台业务结构概览<br style=\"overflow-wrap: break-word;\">2-2 ——平台角色概览<br style=\"overflow-wrap: break-word;\">2-3 ——平台技术结构概览<br style=\"overflow-wrap: break-word;\">2-4 ——平台项目结构概览<br style=\"overflow-wrap: break-word;\">3-1 ——第三章知识点概览<br style=\"overflow-wrap: break-word;\">3-2 ——项目流程：需求-设计-开发-测试-发布<br style=\"overflow-wrap: break-word;\">3-3 ——在线网校平台的一些约定<br style=\"overflow-wrap: break-word;\">3-4 ——java代码规范&amp;数据库设计规范<br style=\"overflow-wrap: break-word;\">3-5 ——数据库设计<br style=\"overflow-wrap: break-word;\">3-6 ——如何使用源代码<br style=\"overflow-wrap: break-word;\">4-1 ——第四章知识点概览<br style=\"overflow-wrap: break-word;\">4-2 ——整合 Spring、Freemarker<br style=\"overflow-wrap: break-word;\">4-3 ——整合 Mybatis<br style=\"overflow-wrap: break-word;\">4-4 ——前端整合：bootstrap，jquery等<br style=\"overflow-wrap: break-word;\">4-5 ——整合七牛图片云存储：接口代码<br style=\"overflow-wrap: break-word;\">4-6 ——完成一个业务流程：注册<br style=\"overflow-wrap: break-word;\">4-7 ——专注于一个表的开发：CRUD<br style=\"overflow-wrap: break-word;\">4-8 ——专注于一个表的开发：分页实现<br style=\"overflow-wrap: break-word;\">5-1 01——整体课程概览：前后端分离、代码补充<br style=\"overflow-wrap: break-word;\">5-2 02——后端ocRest项目的创建，前端Node、TomodJs的安装<br style=\"overflow-wrap: break-word;\">5-3 03——后端在Tomcat中运行ocRest项目，前端在Apache服务器中运行front项目<br style=\"overflow-wrap: break-word;\">5-4 04——前端front的样式、静态页面的整合<br style=\"overflow-wrap: break-word;\">5-5 05——首页—课程分类实现代码编写、front效果实现<br style=\"overflow-wrap: break-word;\">5-6 06——首页—免费课程、实战课程推荐代码编写、front效果实现<br style=\"overflow-wrap: break-word;\">5-7 07——其他代码(课程章节)实战编写<br style=\"overflow-wrap: break-word;\">5-8 08——用SpringBoot实现ocPortal项目<br style=\"overflow-wrap: break-word;\">6-1 ——网站首页——01页面结构介绍<br style=\"overflow-wrap: break-word;\">6-2 ——网站首页——02轮播区课程<br style=\"overflow-wrap: break-word;\">6-3 ——网站首页——03课程分类，课程推荐<br style=\"overflow-wrap: break-word;\">6-4 ——网站首页——04实战推荐，免费好课，java课程<br style=\"overflow-wrap: break-word;\">6-5 ——网站首页——05名校讲师<br style=\"overflow-wrap: break-word;\">6-6 ——课程分类页——01页面结构介绍<br style=\"overflow-wrap: break-word;\">6-7 ——课程分类页——02课程分类筛选<br style=\"overflow-wrap: break-word;\">6-8 ——课程分类页——03分类课程分页<br style=\"overflow-wrap: break-word;\">6-9 ——课程详情页——01页面结构介绍<br style=\"overflow-wrap: break-word;\">6-10 ——课程详情页——02课程信息、章节、教师、推荐课程<br style=\"overflow-wrap: break-word;\">6-11 ——课程详情页——03课程评论、问答<br style=\"overflow-wrap: break-word;\">6-12 ——课程详情页——04关注、收藏<br style=\"overflow-wrap: break-word;\">6-13 ——课程学习页——01页面结构介绍<br style=\"overflow-wrap: break-word;\">6-14 ——课程学习页——02课程章节、评论、问答<br style=\"overflow-wrap: break-word;\">6-15 ——个人中心——01shiro配置<br style=\"overflow-wrap: break-word;\">6-16 ——个人中心——02注册、登录<br style=\"overflow-wrap: break-word;\">6-17 ——个人中心——03主页<br style=\"overflow-wrap: break-word;\">6-18 ——个人中心——04我的课程、我的收藏<br style=\"overflow-wrap: break-word;\">6-19 ——个人中心——05个人信息、修改密码<br style=\"overflow-wrap: break-word;\">6-20 ——个人中心——06课程答疑<br style=\"overflow-wrap: break-word;\">7-1 ——运营端CMS——整体介绍，代码结构<br style=\"overflow-wrap: break-word;\">7-2 ——运营端CMS——网校管理<br style=\"overflow-wrap: break-word;\">7-3 ——运营端CMS——用户管理<br style=\"overflow-wrap: break-word;\">7-4 ——运营端CMS——课程分类管理<br style=\"overflow-wrap: break-word;\">7-5 ——运营端CMS——首页轮播推荐配置<br style=\"overflow-wrap: break-word;\">7-6 ——运营端CMS——01课程管理页<br style=\"overflow-wrap: break-word;\">7-7 ——运营端CMS——02课程管理-课程详情页<br style=\"overflow-wrap: break-word;\">7-8 ——运营端CMS——03课程管理-课程添加<br style=\"overflow-wrap: break-word;\">7-9 ——运营端CMS——统计分析<br style=\"overflow-wrap: break-word;\">8-1 ——M站——功能介绍、项目结构<br style=\"overflow-wrap: break-word;\">8-2 ——M站——01首页<br style=\"overflow-wrap: break-word;\">8-3 ——M站——02详情页<br style=\"overflow-wrap: break-word;\">8-4 ——M站——03学习页<br style=\"overflow-wrap: break-word;\">8-5 ——M站——04我的主页<br style=\"overflow-wrap: break-word;\">8-6 ——M站——微信公众号测试号申请、调试<br style=\"overflow-wrap: break-word;\">8-7 ——M站——微信公众号接入流程介绍<br style=\"overflow-wrap: break-word;\">8-8 ——M站——01 URL、Token认证流程<br style=\"overflow-wrap: break-word;\">8-9 ——M站——02 新浪SAE数据库配置，URL、Token实现接入<br style=\"overflow-wrap: break-word;\">8-10 ——M站——03 消息互动、代码讲解<br style=\"overflow-wrap: break-word;\">8-11 ——M站——账号OAuth认证<br style=\"overflow-wrap: break-word;\">8-12 ——M站——memcache配置<br style=\"overflow-wrap: break-word;\">9-1 ——本地Tomcat部署<br style=\"overflow-wrap: break-word;\">9-2 ——新浪SAE部署<br style=\"overflow-wrap: break-word;\">9-3 ——nginx分布式部署<br style=\"overflow-wrap: break-word;\">9-4 ——面向服务（微服务）架构简单拓展<br style=\"overflow-wrap: break-word;\">10-1 ——课程总结<br style=\"overflow-wrap: break-word;\"><br style=\"overflow-wrap: break-word;\"><br style=\"overflow-wrap: break-word;\">[sell=2,2]</td></tr></tbody></table>', '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Microsoft yahei&quot;, Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px;\">链接:&nbsp;</span><a href=\"https://pan.baidu.com/s/1i0CM29G2HfLnyeTyY5iohg\" target=\"_blank\" style=\"overflow-wrap: break-word; color: rgb(51, 102, 153); text-decoration-line: underline; font-family: &quot;Microsoft yahei&quot;, Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">https://pan.baidu.com/s/1i0CM29G2HfLnyeTyY5iohg</a><span style=\"color: rgb(68, 68, 68); font-family: &quot;Microsoft yahei&quot;, Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px;\"></span><br style=\"overflow-wrap: break-word; color: rgb(68, 68, 68); font-family: &quot;Microsoft yahei&quot;, Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px;\"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Microsoft yahei&quot;, Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px;\">密码: 7cm6</span><br style=\"overflow-wrap: break-word; color: rgb(68, 68, 68); font-family: &quot;Microsoft yahei&quot;, Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px;\"><br style=\"overflow-wrap: break-word; color: rgb(68, 68, 68); font-family: &quot;Microsoft yahei&quot;, Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px;\"><span style=\"color: rgb(68, 68, 68); font-family: &quot;Microsoft yahei&quot;, Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px;\">qihoo</span><br></p>', '/profile/upload/2019/10/08/eb69d6e965dbe187876ad1f82100eb50.png', '实战', 0, 0, 'admin', '2019-10-08 15:59:50', 'admin', '2019-10-08 15:59:50', '');
